import React from "react";

const MovieMenu = () => {
  return (
    <div>
      <ul>
        <li>Popular</li>
        <li>Now Playing</li>
        <li>UpComing</li>
        <li>Top Rated</li>
      </ul>
    </div>
  );
};

export default MovieMenu;
